        --color: red;

    ::selection {
        color: white;

    body {

    }
    .topbar{
        color: var(--color);
        text-align: center;
        font-family: monospace;
        text-shadow: 0px 0px 5px var(--color);
    }
    button {
        font-size: 80pt;

        font-family: monospace;

        -moz-box-shadow: 0px 0px 20px 0px var(--color);
        text-shadow: 0px 0px 5px var(--color);
        transition: 1s;
        border-radius: 10px;
        vertical-align: middle;
        position: fixed;
        top: 40%;
        padding: 10px;
    }
    button:hover {
        text-shadow: 0px 0px 15px var(--color);
        box-shadow: 0px 0px 40px 0px var(--color);
        -webkit-box-shadow: 0px 0px 40px 0px var(--color);
        -moz-box-shadow: 0px 0px 40px 0px var(--color);
        transform: scale(110%);
        border: 2px solid var(--color);
    }
    .parent {
        display: flex;
        align-items: center center;
        align-content: center center;
        place-content: center center;
        vertical-align: middle;
    }
</style>
